import React, {Component} from 'react'

class BaseComponent extends Component {
    render() {
        return (
            <div className="container-fluid">
                <div className="row">
                    <div className="col-md-3">
                        dsfsdfsd
                    </div>
                    <div className="col-md-9">
                        Second component
                    </div>
                </div>
            </div>
        )
    }
}

export default BaseComponent
